O objetivo do referido processo é a locação de um espaço para acolhimento dos servidores da educação no dia 31 de janeiro de 2025. O corpo docente, é essencial para o funcionamento de uma escola. Por isso, realizar um bom acolhimento aos professores é de extrema importância para a produtividade e motivação dos mesmos. Apenas com professores motivados uma instituição educacional anda para frente. Pensando nisso, preparamos esse plano de acolhimento, para colher os funcionários das escolas em um novo inicio de ano. É através do acolhimento de professores que tudo começa a se encaixar e se encaminhar, por isso, é muito importante. Professores motivados, geram alunos estudiosos, que geram pais satisfeitos. A lógica é simples e direta. Isso tudo ajudará as nossas instituições a se destacarem para a sociedade.



O espaço deverá ser coberto e climatizado, com capacidade mínima para 450 (quatrocentos e cinquenta) pessoas sentadas, com sonorização, iluminação e decoração para realização de palestra motivacional no dia 31 de janeiro para o acolhimento dos professores para o inicio do ano letivo de 2025.



O ambiente deverá ser composto dos seguintes elementos:

a) 450 (quatrocentos e cinquenta) cadeiras do mesmo padrão, preferencialmente modelo Tiffany;

b) 01 (um) telão (lona) para projeção medindo no mínimo 0, 80 X 2,5;

c) 01 data show,

d) Equipamento de sonorização, mesa e caixas de som, com o operador técnico, e no mínimo 2 (dois) microfones sem fios;

01 (um) ambiente para registro fotográfico.
